import three;
size(2.5inch);
currentprojection = orthographic(1/2,-1,1/4);
triple A = (0,0,6);
triple[] base = new triple[4];
base[0] = (-4, -4, 0);

base[1] = (4, -4, 0);
base[2] = (4, 4, 0);
base[3] = (-4, 4, 0);
triple[] mid = new triple[4];
for(int i=0; i < 4; ++i)
